window.bookSummaryJSON = "<p>This audiobook box set collects the first three installments of John Hindmarsh's epic Jack Foster Space Opera series.</p> <p>Book 1, Violent Graduation: It’s easy to ignore dangerous issues while you’re studying at the Royal Space Navy’s academy—that is, it is until a sniper attempts to assassinate you.</p> <p>Book 2, Rescue the Princess: Join Jack and his bot and AI friends as they combat sabotage and alien threats as they search for a missing princess…who just might rescue herself.</p> <p>Book 3, Jack's Planet: Join Jack and his team—ever increasing—in their venture to help their new friends, the Tirage, against slave traders and Jack Foster's Planet against illegal mining.</p>"; 
